export const sellerNavigations = [
  {
    name: "Products",
    type: "dropDown",
    icon: "i-Shopping-Bag",
    sub: [
      {
        name: "Add Product",
        path: "/seller/add-product",
        type: "link",
      },
      {
        name: "My Products",
        path: "/seller/my-products",
        type: "link",
      },
    ],
  },
];

export default sellerNavigations;
